import { AtpAgent } from "@atproto/api";
/**
 * {@link AtpAgent} with rate limited methods.
 */
export class RateLimitAgent extends AtpAgent {
    constructor(options, limiter) {
        super(options);
        this.sessionManager.setFetch(async (...args) => {
            await limiter.limit();
            return fetch(...args);
        });
    }
}
